import React, {useState} from "react"
import axios from 'axios'
import './log-in/login.css';

const Test = () =>{

    const [user,setUser] = useState({
        email:"",
        password:""
    })
    const handleChange = e =>{
        const {name,value} = e.target
        setUser({
           ...user,
           [name]:value
        })
    }

    const register = () =>{
        const { email, password} = user
        axios.post("http://localhost:9080/login",user).then(res =>console.log(res))
    }

    return (

        <>
        <div className="login">
        <h1>Log In</h1>
        <div> <input type="text" name="email" value={user.email} placeholder="E-mail Or Phone Number" onChange={handleChange}/></div>
        <div> <input type="password" name="password" value={user.password} placeholder="Password" onChange={handleChange}/></div>
        <div><button onClick={register} >Log In</button></div>

        <div><a href="/"> Sign Up ?</a></div>
        <a href="/">Reset Password ?</a>
        </div>
        </>
    );
}
export default Test;
